import React from 'react';

import './ExternalButton.css'

const ExternalButton = ({ text, link }) => {
    return(
        <div>
            <a rel="noopener noreferrer" href={link} style={{ textDecoration: 'none' }}>
                <div className="ex-button">
                    {text}
                </div>
            </a>
        </div>
    );
}

export default ExternalButton;
